port CoupleDask\nimport numpy as np\nimport pandas as pd\nimport yaml\nimport dask.array as da\nfrom dask.distributed import performance_report\nfrom dask_ml.decomposition import IncrementalPCA\n\n\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Ssize = data[\"parallelism\"][\"height\"]*data[\"parallelism\"][\"width\"]\n    generations = data[\"MaxtimeSteps\"]\n    Sworkers = data[\"workers\"]\n    timeStep = 1\nC = Initialization(Ssize, Sworkers)\nC.client.get_versions(check=True)\n\n\n# Results \nResults = []\n\n# perf holds different time measurements \n# generation, getdata, get-from-queues, computation \nperf = np.empty([generations//timeStep, 4])\nt = time.perf_counter()\n\n\nwith performance_report(filename=\"dask-report.html\"):\n    for g in range(0, generations, timeStep):\n        tic3 = time.perf_counter()\n        tic = time.perf_counter()\n        arrays, perf[g//timeStep][2] = C.get_data()\n        arrays = da.reshape(arrays, (arrays.shape[1],arrays.shape[2])) \n        toc = time.perf_counter()\n        perf[g//timeStep][1] = toc - tic\n        tic1 = time.perf_counter()\n        if g==0:\n            pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{"coordinates":null,"formatter":{"id":"1473"},"group":null,"major_label_policy":{"id":"1474"},"ticker":{"id":"1127"}},"id":"1126","type":"LinearAxis"},{"attributes":{},"id":"1300","type":"ResetTool"},{"attributes":{},"id":"1439","type":"AllLabels"},{"attributes":{"source":{"id":"1213"}},"id":"1398","type":"CDSView"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1277","type":"Line"},{"attributes":{"axis":{"id":"1126"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1129","type":"Grid"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1033","type":"Quad"},{"attributes":{},"id":"1059","type":"ResetTool"},{"attributes":{"source":{"id":"1002"}},"id":"1035","type":"CDSView"},{"attributes":{},"id":"1452","type":"AllLabels"},{"attributes":{"axis_label":"Bytes / second","coordinates":null,"formatter":{"id":"1364"},"group":null,"major_label_policy":{"id":"1316"},"ticker":{"id":"1297"}},"id":"1296","type":"LinearAxis"},{"attributes":{},"id":"1438","type":"BasicTickFormatter"},{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{},"id":"1479","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"dimensions":"width"},"id":"1142","type":"PanTool"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":
